import axios from "axios";
import { set } from "mongoose";
import { useEffect, useState } from "react";

const deleteFromDataBase = () => {
  prompt("Are you sure?");
};

const KitchenService = () => {
  const [display, setDisplay] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:8081/fetchFromDataBase")
      .then((display) => setDisplay(display.data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <div>
      {
        <tr>
          <th>
            <span style={{ "margin-right": "115px" }}> </span>
          </th>
          <th>
            <span style={{ "margin-right": "115px" }}>Order</span>
          </th>
          <th>
            <span style={{ margin: "15px" }}>Quantity</span>
          </th>
        </tr>
      }
      {display.map((item) => {
        return (
          <>
            <table
              border={"1px solid black"}
              style={{
                borderCollapse: "collapse",
                width: "35%",
              }}
            >
              <tr>
                <td>
                  <input type="checkbox"></input>
                </td>
                <td>
                  <span style={{ padding: "50px" }}>{item.name}</span>
                </td>
                <td>
                  <span style={{ padding: "20px" }}>{item.quantity}</span>
                </td>
                <td>
                  <button onclick={deleteFromDataBase}>Confirm</button>
                </td>
              </tr>
            </table>
          </>
        );
      })}
    </div>
  );
};

export default KitchenService;
